Analyze, Share, and Act.**"]},{"cell_type":"markdown","id":"a6a9a5f0","metadata":{"papermill":{"duration":0.020657,"end_time":"2024-02-22T15:07:08.271836","exception":false,"start_time":"2024-02-22T15:07:08.251179","status":"completed"},"tags":[]},"source":["## <span style=\"color:#0E4C92\"> **About the Company** </span> <a id=\"company\"></a>\n","\n","\n","Bellabeat, a high-tech company that manufactures health-focused smart products. They designed technology that informs and inspires women around the world. Collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women with knowledge about their own health and habits. Since it was founded in 2013, Bellabeat has grown rapidly and quickly positioned itself as a tech-driven wellness company for women. \n","\n","By 2016, Bellabeat had opened offices around the world and launched multiple products. Bellabeat products became available through a growing number of online retailers in addition to their own e-commerce channel on their website. The company has invested in traditional advertising media, such as radio, out-of-home billboards, print, and television, but focuses on digital marketing extensively\n"]},{"cell_type":"markdown","id":"b523cd48","metadata":{"papermill":{"duration":0.021236,"end_time":"2024-02-22T15:07:08.315467","exception":false,"start_time":"2024-02-22T15:07:08.294231","status":"completed"},"tags":[]},"source":["## <span style=\"color:#0E4C92\"> **Ask Phase** </span> <a id=\"ask\"></a>"]},{"cell_type":"markdown","id":"b1ac0294","metadata":{"papermill":{"duration":0.020347,"end_time":"2024-02-22T15:07:08.356407","exception":false,"start_time":"2024-02-22T15:07:08.33606","status":"completed"},"tags":[]},"source":["### <span style=\"color:#0E4C92\"> **Business Task** </span> <a id=\"business\"></a>\n","\n","Determine and identify trends in smart device usage and how Bellabeat can benefit from them for their marketing strategy."]},{"cell_type":"markdown","id":"aabbdb3f","metadata":{"papermill":{"duration":0.021542,"end_time":"2024-02-22T15:07:08.399166","exception":false,"start_time":"2024-02-22T15:07:08.377624","status":"completed"},"tags":[]},"source":["### <span style=\"color:#0E4C92\"> **Key Stakeholders** </span> <a id=\"key\"></a>\n","\n","1. Bellabeat’s co founder and Chief Creative Officer \n","1. Bellabeat’s co founder and Mathematician; key member of the Bellabeat executive team\n","1. Bellabeat marketing analytics team\n"]},{"cell_type":"markdown","id":"851fcca0","metadata":{"papermill":{"duration":0.020453,"end_time":"2024-02-22T15:07:08.44058","exception":false,"start_time":"2024-02-22T15:07:08.420127","status":"completed"},"tags":[]},"source":["## <span style=\"color:#0E4C92\"> **Prepare Phase** </span> <a id=\"prepare\"></a>\n"]},{"cell_type":"markdown","id":"382bc915","metadata":{"papermill":{"duration":0.02019,"end_time":"2024-02-22T15:07:08.481044","exception":false,"start_time":"2024-02-22T15:07:08.460854","status":"completed"},"tags":[]},"source":["### <span style=\"color:#0E4C92\"> **Data Sources** </span> <a id=\"data_sources\"></a> \n","\n","[FitBit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit/code) (CC0: Public Domain, dataset made available through Mobius) is a public dataset from Kaggle that contains personal fitness trackers from thirty fitbit users. The dataset contains 18 files in CSV format. The table below shows the descriptions of all data sources;\n","\n","| File Name | Description |\n","| --- | --- |\n","| dailyActivity_merged.csv | This file contains all the daily activities including total steps, calorie burn and measures of time and distance for 4 intensities for 33 users |\n","| dailyCalories_merged.csv | This file contains calorie burn per day for a period of time for 33 users |\n","| dailyIntensities_merged.csv | This file contains distance and time for different intensities (Sedentary Active,Light Active,Moderate Active, Very Active) for 33 users | \n","| dailySteps_merged.csv | This file contains total step taken per day for a period of time for 33 users |\n","|heartrate_seconds_merged.csv |This file contains heart rate per seconds for a period of time for 14 users  |\n","| hourlyCalories_merged.csv |This file contains hourly calorie for a period of time for 33 users  |\n","| hourlyIntensities_merged.csv|This file contains Total and Average intensity for a period of time for 33 users  |\n","| hourlySteps_merged.csv | This file contains hourly steps for a period of time for 33 users |\n","| minuteCaloriesNarrow_merged.csv | This file contains calorie burn per minute for a period of time for 33 users (long format) |\n","| minuteCaloriesWide_merged.csv | This file contains calorie burn per minute for a period of time for 33 users (wide format) |\n","| minuteIntensitiesNarrow_merged.csv | This file contains intensity per minute for a period of time for 33 users (long format) |\n","| minuteIntensitiesWide_merged.csv |This file contains intensity per minute for a period of time for 33 users (wide format) |\n","|minuteMETsNarrow_merged.csv|This file contains metabolic equivalent of task (MET) per minute for a period of time for 33 users (long format)|\n","|minuteSleep_merged.csv|This file contains sleep per minute for a period of time for 24 users. Definition of value and LogId columns are unknown|\n","|minuteStepsNarrow_merged.csv|This file contains steps taken per minute for a period of time for 33 users. (long format)|\n","|minuteStepsWide_merged.csv|This file contains steps taken per minute for a period of time for 33 users. (wide format)|\n","|sleepDay_merged.csv|This file contains the total sleep record, minutes asleep and minutes in bed for a day for 24 users|\n","|weightLogInfo_merged.csv|This file contains the weight.fat and BMI information for 8 users. 5 of them are reports manually while 3 are not|"]},{"cell_type":"markdown","id":"3af26105","metadata":{"papermill":{"duration":0.020079,"end_time":"2024-02-22T15:07:08.521218","exception":false,"start_time":"2024-02-22T15:07:08.501139","status":"completed"},"tags":[]},"source":["###  <span style=\"color:#0E4C92\"> **Data Credibility and Integrity** </span> <a id=\"data_credibility\"></a> \n","\n","This dataset was generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016. Mobius is the main collaborator of this dataset is licensed by CC0: Public Domain"]},{"cell_type":"markdown","id":"d2675cd5","metadata":{"papermill":{"duration":0.020175,"end_time":"2024-02-22T15:07:08.56161","exception":false,"start_time":"2024-02-22T15:07:08.541435","status":"completed"},"tags":[]},"source":["### <span style=\"color:#0E4C92\"> **Data Bias** </span> <a id=\"data_bias\"></a> \n","\n","It is observed that the dataset is coming from only 33 FitBit users with unknown age,gender,race and geographical locations. This may cause inaccuracy in our analysis because the data is not an accurate representation of the population."]},{"cell_type":"markdown","id":"254e0d0f","metadata":{"papermill":{"duration":0.020164,"end_time":"2024-02-22T15:07:08.601798","exception":false,"start_time":"2024-02-22T15:07:08.581634","status":"completed"},"tags":[]},"source":["## <span style=\"color:#0E4C92\"> **Process Phase** </span> <a id=\"process\"></a> \n"]},{"cell_type":"markdown","id":"ad8beeef","metadata":{"papermill":{"duration":0.021945,"end_time":"2024-02-22T15:07:08.643926","exception":false,"start_time":"2024-02-22T15:07:08.621981","status":"completed"},"tags":[]},"source":["### <span style=\"color:#0E4C92\"> **Tools** </span> <a id=\"tools\"></a> \n","\n","In this analysis, we will be using the R programming language for the processing,data cleaning, data manipulation and data visualization.\n"]},{"cell_type":"markdown","id":"04994d3a","metadata":{"papermill":{"duration":0.020675,"end_time":"2024-02-22T15:07:08.685345","exception":false,"start_time":"2024-02-22T15:07:08.66467","status":"completed"},"tags":[]},"so