4","exception":false,"start_time":"2024-02-22T15:07:20.39898","status":"completed"},"tags":[]},"source":["## <span style=\"color:#0E4C92\"> **Act Phase** </span> <a id=\"Act\"></a> "]},{"cell_type":"markdown","id":"68067fad","metadata":{"papermill":{"duration":0.036396,"end_time":"2024-02-22T15:07:20.508069","exception":false,"start_time":"2024-02-22T15:07:20.471673","status":"completed"},"tags":[]},"source":["### <span style=\"color:#0E4C92\"> **Conclusion** </span> <a id=\"conclusion\"></a> \n"]},{"cell_type":"markdown","id":"f320f555","metadata":{"papermill":{"duration":0.035681,"end_time":"2024-02-22T15:07:20.579317","exception":false,"start_time":"2024-02-22T15:07:20.543636","status":"completed"},"tags":[]},"source":["Bellabeat is a high-tech manufacturer of health-focused products for women.\n","The goal of the study is to identify the trends for smart device users and use these trends to help BellaBeat's marketing strategies.\n","\n","Based on the analysis,these are the recommendations that may help the marketing team in their strategy.\n","\n","#### **1. A reward system for completing the daily step goal**\n","- Based from the visual of `calorie burn vs total steps taken`, users who took higher number of steps burn more calories in a day.\n","- We could send a daily notification to all users to complete the daily steps goal (e.g 10,000 steps) along with the calorie burn and health benefits for reaching the goal\n","- If users complete a daily goal, they will receive an accumulable reward points in which they can redeem for discounts in any of Bellabeat's products\n","\n","#### **2. Sleep reminder notification**\n","- The results from the visual of `minutes asleep per day` indicates that all of the users dont sleep the recommended amount of sleep\n","- The team could send a daily reminder notification to all users the benefits of sleeping atleast 8 hours a day\n","\n","#### **3. Sending of marketing videos,gym workout tips and exercise routine during active user hours**\n","- The result from `Most Active hour` visuals shows that people are active during 5am-10pm and the peak is between 5pm-7pm.We can assume that during this time most users are exercising after work by going for a run or going to the gym.\n","- We may make use of these active hours to send Bellabeat's product marketing videos, gym workout tips, and exercise routines. This would help users who are doing exercise during these times and as well as help the company in increasing user engagement."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":1041311,"sourceId":1752235,"sourceType":"datasetVersion"}],"dockerImageVersionId":30352,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":16.863032,"end_time":"2024-02-22T15:07:20.740412","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-02-22T15:07:03.87738","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}